import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Game2048 from "./Game2048";
import {RecoilRoot} from "recoil";

ReactDOM.render(
    <React.StrictMode>
        <RecoilRoot>
            <Game2048/>
        </RecoilRoot>
    </React.StrictMode>,
    document.getElementById('root')
);
